function build() {
    // Pego o elemento com o id="mytextarea", que é onde será copiado a planilha com os participantes
	var textarea = document.getElementById('mytextarea');
    // Separando o conteúdo da planilha por linhas
	var lines = textarea.value.split('\n');
    // A primeira linha contém as tags
	var tags = lines[0].split('\t');
    // Criação de um array que irá armazenar os dados de cada participante
	var participantes = [];
	for(var i = 1; i < lines.length - 1; i++) {
        // Separando os dados do participante
		var line = lines[i].split('\t');
        // Criação de um objeto que representa um participante e sua adição no array de participantes
		var obj = {};
		for(var j = 0;  j < tags.length; j++) {
			obj[tags[j]] = line[j];	
		}
		participantes.push(obj);	
	}
    // Um objeto que representa como vai ser o arquivo pdf de acordo com o pdfmake
	var docDefinition = {
		// O tipo de papel
        pageSize: 'A7',
		// O background
        // Por conta do pdfmake tem que ser colocado no formato base64
        background: [
			{
                image: 'data:image/png;base64,',
			    // Como o background irá preencher a página
                fit: [300,300]
 			}
		],
        // Metadados do pdf
		info: {
            title: 'Crachás',
			author: 'Vitor Oliveira',
    		subject: 'Crachás para o evento',
    		keywords: 'cracha',
  		}
	};
    // Um array que irá conter as informações de cada participante no formato pra inserir no pdf
	var styling = [];
    // Organizando como as informações de cada participante será inserido no seu crachá, seguindo as normas do pdfmake
	for(var i = 0; i < participantes.length; i++) {
		if (i == participantes.length - 1) {
			styling.push({text: participantes[i]['Nome'], fontSize: 12, bold: true, margin: [0, 100, 0, 0], alignment: 'center'},
			participantes[i]["Instituição"] != 'Não Respondeu' ? {text: participantes[i]['Instituição'], fontSize: 8, alignment: 'center'} : {}, {text: participantes[i]['País'], fontSize: 8, alignment: 'center'});
		} else {
			styling.push({text: participantes[i]['Nome'], fontSize: 12, bold: true, margin: [0, 100, 0, 0], alignment: 'center'},
			participantes[i]["Instituição"] != 'Não Respondeu' ? {text: participantes[i]['Instituição'], fontSize: 8, alignment: 'center'} : {}, {text: participantes[i]['País'], fontSize: 8, alignment: 'center', pageBreak: 'after'});
		}
	}
    // O atributo content é o atributo que determina o content do pdf, nesse caso as informações de cada participante.
	docDefinition.content = styling;
	pdfMake.createPdf(docDefinition).download('crachas.pdf');
}